import React, { Component } from "react";
import Twit from "./Twit";

class TwitList extends Component {
  static defaultProps = {
    data: [],
  };
  render() {
    const { data } = this.props;
    const list = data.map((el) => {
      <Twit key={el.id} basic={el} />;
    });
    return <div>{list}</div>;
  }
}

export default TwitList;
